import React from "react";
import Button from 'react-bootstrap/Button';
const btn = () => {
    return (
        <div>
                      <h3>conunter value is {} </h3>
              <Button variant="primary">incremement</Button>
              <Button variant="secondary">decrememet</Button>
        </div>
    )
}

export default btn
